namespace AdaPositions.Test.Integration {

  [TestClass]
  public class DoTestMetrics {

    private SettingsService _settingsService;
    private BlockfrostService _blockfrostService;
    public DoTestMetrics() {

      var MsgLog = new LogMsg();
      _settingsService = new SettingsService(FileExts.SettingsTestFileName, MsgLog);
      string ApiKey = _settingsService.Settings[SettingCol.BlockFrostApiKey].Value;
      _blockfrostService = new BlockfrostService(ApiKey, new LogMsg());
    }

    [TestMethod]
    public async Task TestMetrics() {

      var metrics =  await _blockfrostService.CaptureMetrics().ConfigureAwait(false);
      
      Assert.IsTrue(metrics > 0);
      Console.WriteLine($"Last Today: {_blockfrostService.LastToday}");
      Console.WriteLine($"Last Calls Count: {_blockfrostService.LastCallsCount}");

    }


    [TestMethod]
    public async Task Test_GetAddressDetails() {

      var address = "addr1qxj2k589ns7yuslsac3wec2s56v3dsladl4ze0lmg30gy0l224axwmgahexl0a3r5w6dhrdrvckfh55pdntpscv4l88qd7n06d";
      var details = await _blockfrostService.GetAddressDetailsAsync(address).ConfigureAwait(false);

      Assert.IsNotNull(details);

      Console.WriteLine($"Address: {address}");
      Console.WriteLine($"Address: {details.Address}");
      Console.WriteLine($"strOpParam1 Address: {details.StakeAddress}");
      Console.WriteLine($"Script: {details.Script}");
      Console.WriteLine($"Amount: {details.Amount}");
      Console.WriteLine($"Type: {details.Type}");

      
      var arr = details.Amount.ToAmountList();

      foreach (var amount in arr) {

        Console.WriteLine($"Unit: {amount.Unit}");
        Console.WriteLine($"Quantity: {amount.Quantity}");
      }

    }

